class Solution:    def restoreIpAddresses(self, s):        """        :type s: str        :rtype: List[str]        """        def check(a,b,s):            if int(s[a:b])>255:                return False            if s[a]=="0" and b-a>1:                return False            return True        n,res=len(s),[]        if n<4 or n>12:            return []        for a in range(1,4):            for b in range(a+1,a+4):                for c in range(b+1,b+4):                    if c<n:                        if check(0,a,s) and check(a,b,s) and check(b,c,s) and check(c,n,s):                            res.append(""+s[:a]+"."+s[a:b]+"."+s[b:c]+"."+s[c:])        return ress=Solution()print(s.restoreIpAddresses("010010"))